define('text!template/collections-nav.html',[],function () { return '<ul>\n  {{#each config}}\n      <li class="nav-category {{#if selected}}selected{{/if}}" id="gallery-category-{{name}}">\n        {{spacify name}}\n        {{#if selected}}\n          <div class="thumbnail-gallery">\n            {{#each ../categoryData}}\n              <div class="thumbnail">\n                <img src="img/thumbnails/{{thumb}}" id="gallery-img-{{slug}}"/>\n              </div>\n            {{/each}}\n          </div>\n        {{/if}}\n      </li>\n  {{/each}}\n</ul>\n';});

define('app/gallery',[],() => ({
    renderCollectionsNavContent: ($, Handlebars, template, categoryNames, currentCategory, categoryData) => {
      var compiled = Handlebars.compile(template);
      function getCategoryNavConfig(categoryNames, newCurrentCategory) {
        return categoryNames.map((categoryName) => ({
          name: categoryName,
          selected: categoryName === newCurrentCategory
        }));
      }
      $('#collections-nav-content').html(compiled({
        config: getCategoryNavConfig(categoryNames, currentCategory),
        categoryData: categoryData
      }));
    },
    renderLightbox: ($, Handlebars, template, painting, prevSlug, nextSlug) => {
      var compiled = Handlebars.compile(template);
      $('#detail-view-content').html(compiled({
        painting: painting,
        prevSlug: prevSlug,
        nextSlug: nextSlug
      }));
    }
}));


define('text!template/lightbox.html',[],function () { return '{{# if painting.is-text}}\n  <div class="lightbox">\n    <div class="lightbox-header">\n      <button class="close-trigger"><img src="img/x.svg"/></button>\n    </div>\n    <div class="lightbox-image">\n      {{#if prevSlug}}\n        <button class="left-trigger" id="goto-{{prevSlug}}">\n          <img src="img/arrow.svg"/>\n        </button>\n      {{/if}}\n      <div class="lightbox-plaintext">\n        <p>\n          {{#each painting.copy}}\n            {{this}}<br/>\n          {{/each}}\n          {{#if painting.byline}}\n            <span class="right">{{painting.byline}}</span>\n          {{/if}}\n      </p>\n      </div>\n      {{#if nextSlug}}\n        <button class="right-trigger" id="goto-{{nextSlug}}">\n          <img src="img/arrow.svg"/>\n        </button>\n      {{/if}}\n    </div>\n  </div>\n{{else if painting.title}}\n  <div class="lightbox">\n    <div class="lightbox-header">\n      <button class="close-trigger"><img src="img/x.svg"/></button>\n    </div>\n    <div class="lightbox-image">\n      {{#if prevSlug}}\n        <button class="left-trigger" id="goto-{{prevSlug}}">\n          <img src="img/arrow.svg"/>\n        </button>\n      {{/if}}\n      <img src="img/works/{{painting.filename}}" />\n      {{#if nextSlug}}\n        <button class="right-trigger" id="goto-{{nextSlug}}">\n          <img src="img/arrow.svg"/>\n        </button>\n      {{/if}}\n    </div>\n    <div class="lightbox-caption">\n      <p>"{{painting.title}}" &mdash; {{painting.media}}. {{painting.dimensions}}. {{painting.date}}.</p>\n    </div>\n  </div>\n{{/if}}\n';});

requirejs.config({
    baseUrl: 'scripts/lib',
    paths: {
        app: '../app',
        data: '../data',
        template: '../template'
    }
});

requirejs([
  'jquery',
  'handlebars',
  'text!data/collections.json',
  'text!template/collections-nav.html',
  'app/gallery',
  'text!template/lightbox.html'
],
($, Handlebars, rawData, navTemplate, gallery, lightboxTemplate) => {
    var data = JSON.parse(rawData);
    var categoryNames = Object.keys(data);
    Handlebars.registerHelper('spacify', (text) => text.replace(/\-/g, ' '));

    function render(currentCategory, selectedImage) {
      var categoryData = data[currentCategory];
      gallery.renderCollectionsNavContent($, Handlebars, navTemplate, categoryNames, currentCategory, categoryData);

      var selectedImageIndex;
      var prevSlug;
      var nextSlug;
      var prevSlug = selectedImageIndex > 0 ? data[currentCategory][selectedImageIndex - 1].slug : null;
      var nextSlug = selectedImageIndex < currentCategory.length ? data[currentCategory][selectedImageIndex + 1].slug : null;

      // render lightbox, if applicable
      if (selectedImage) {
        $('.blanket').show();
        selectedImageIndex = categoryData.indexOf(selectedImage);
        if (selectedImageIndex > 0) {
          prevSlug = categoryData[selectedImageIndex - 1].slug;
        }
        if (selectedImageIndex < categoryData.length - 1) {
          nextSlug = categoryData[selectedImageIndex + 1].slug;
        }
        gallery.renderLightbox($, Handlebars, lightboxTemplate, selectedImage, prevSlug, nextSlug);
      } else {
        $('.blanket').hide();
        gallery.renderLightbox($, Handlebars, lightboxTemplate, selectedImage, null, null);
      }

      // select a collection
      $('li.nav-category').click((event) => {
        var targetId = $(event.target).attr('id');
        var newCategoryName = targetId.replace('gallery-category-', '');
        render(newCategoryName);
      });

      // open lightbox
      $('.thumbnail').click((event) => {
        var targetId = $(event.target).attr('id');
        var imgSlug = targetId.replace('gallery-img-', '');
        selectedImage = categoryData.find((image) => image.slug === imgSlug);
        render(currentCategory, selectedImage);
      });

      // change featured image
      $('.left-trigger, .right-trigger').click((event) => {
        event.preventDefault();
        var targetId = $(event.target).attr('id');
        var imgSlug = targetId.replace('goto-', '');
        selectedImage = categoryData.find((image) => image.slug === imgSlug);
        render(currentCategory, selectedImage);
      });

      // close lightbox
      $('.close-trigger').click((event) => {
        event.preventDefault();
        render(currentCategory, null);
      });
      $('.blanket').click((event) => {
        render(currentCategory, null);
      });
      $(document).keyup((e) => {
        if (e.keyCode == 27) { // esc key
          render(currentCategory, null);
        }
        if (prevSlug && e.keyCode == 37) { // left arrow key
          selectedImage = categoryData.find((image) => image.slug === prevSlug);
          render(currentCategory, selectedImage);
        }
        if (nextSlug && e.keyCode == 39) { // right arrow key
          selectedImage = categoryData.find((image) => image.slug === nextSlug);
          render(currentCategory, selectedImage);
        }
      });
    }

    // initial render
    render(categoryNames[0], null);
});

define("main", function(){});

